import React, { Component } from 'react';
import PropTypes from 'prop-types';

class cardheading extends Component {
    static propTypes = {
        heading: PropTypes.string.isRequired,
      }; 
    render() {
        const { heading } = this.props;
        return (
            <div className="h6">
                {heading}
            </div>
        );
    }
}

export default cardheading;
